To reproduce the simulations run published by the authors, the model has to be simulated with any
                        of two different approaches. First, one could use a deterministic method (

                            KISAO_0000035

                        ) with continuous variables (

                            KISAO_0000018

                        ). One sample algorithm to use is the CVODE solver (

                            KISAO_0000019

                        ). Second, one could simulate the system using Gillespie's direct method (

                            KISAO_0000029

                        ), which is a stochastic method (

                            KISAO_0000036

                        ) supporting adaptive timesteps (

                            KISAO_0000041

                        ) and using discrete variables (

                            KISAO_0000016

                        ).
